// WorkoutPlans.tsx
import React from 'react';
import { Container, Typography, Box } from '@mui/material';
import Workout from './Cards'; // Assuming Workout.tsx is in the same directory

const WorkoutPlans: React.FC = () => {
  // Assume workout plan data is fetched or provided
  const workoutPlans = [
    { id: 1, title: 'Workout Plan 1', description: 'This is workout plan 1', image: 'image1.jpg' },
    { id: 2, title: 'Workout Plan 2', description: 'This is workout plan 2', image: 'image2.jpg' },
    // Add more workout plan data as needed
  ];

  const defaultOnClickPlan = () => {
    // Provide a default or placeholder function for onClickPlan
    console.log('Default onClickPlan function');
  };

  return (
    <Container maxWidth="md" sx={{ textAlign: 'center', mt: 3 }}>
      <Typography variant="h4" color="primary" gutterBottom>
        Workout Plans
      </Typography>
      <Box>
        {workoutPlans.map((workoutPlan) => (
          <Workout key={workoutPlan.id} {...workoutPlan} onClickPlan={defaultOnClickPlan} />
        ))}
      </Box>
    </Container>
  );
};

export default WorkoutPlans;
